import logo from './logo.svg';
import './App.css';
import Profile from "./Profile.js"


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>My Portfolio Page</h1>
        <Profile></Profile>
      </header>
    </div>
  );
}



export default App;
